import React from "react"
import ReactDOM from "react-dom"

export default function About(){

    return(
        <div>
            <h3 className="About--header">About</h3>
            <p className="About--"> Currently, I am a full-time college student at 
                The University of Texas at Dallas. With a particular interest in making
                things efficient, Seeing new technologies really thrives me to learn and grind out new stuffs.
            </p>


        </div>
    )

}
